import React from 'react';
import Task from './task';
import './tasklist.css';

const Trash = ({ tasks }) => {
  const trashedTasks = tasks.filter(task => task.trashed);

  return (
    <div className="task-list">
      {trashedTasks.map(task => (
        <Task key={task.id} task={task} />
      ))}
    </div>
  );
};

